import React, { Component } from "react";
import "../App.css";
import logo from "../immagini/logo.png";
import { Container, Row, Col, Button } from "react-bootstrap";

export default class notFound extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="Chisiamo" style={{ paddingBottom: "8rem" }}>
        <Container>
          <Row>
            <Col sm>
              <h1 style={{ fontSize: "400px" }}>4</h1>
            </Col>
            <Col sm>
              <img
                src={logo}
                alt="studenti"
                width="110%"
                className="imgChisiamo"
                style={{ marginTop: "3rem" }}
              />
            </Col>
            <Col sm>
              <h1 style={{ fontSize: "400px" }}>4</h1>
            </Col>
          </Row>
          <Row>
            <Col sm>
              <h4>
                La pagina che stavi cercando non esiste! Premi qui per tornare
                alla Home
              </h4>
            </Col>
          </Row>
        </Container>
      </div>
    );
  }
}
